import React from 'react'
import { Link } from 'react-router-dom';

const NavItem = ({text, url, key}) => {
  return (
    <li className='inline-block my-auto w-1/3 border-r-2 border-stone-300'>
      <Link to={url}>
        <a className=' text-center'>{text}</a>
      </Link>
    </li>
  )
}

export default NavItem
